import { Card } from 'react-bootstrap' 

// replace with class component
function Programs({ programs }) {
  return (
    <Card className="my-3 p-3 rounded" >
    <a href={'/programs/${programs._id}'}>
        <Card.Img src={programs.image}/>
    </a>
    </Card>
  )
}

export default Programs
